import './App.css';
import { Menu } from './compo/menu';
import { Routing } from './compo/routing';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
     <Menu></Menu>
     <Routing></Routing></BrowserRouter>
    </div>
  );
}

export default App;
